import React from "react";

const Movie = () => {
  return (
    <div className="col-sm-12 m6 l3">
      <div className="card">
        <div className="card-image waves-effect waves-block waves-light">
          {props.image == null ? <img src="" alt="" /> : <img src="" alt="" />}
        </div>
      </div>
    </div>
  );
};
